window.bookSummaryJSON = "<p><b><i>Groundhog Day</i></b><b> meets the worst super-spy, ever. </b></p> <p>Every time Rueben Peet dies, he \"returns\" to his body with the memories of what's to come. It seems that he gets to \"repeat\" his mistakes again and again.&nbsp;</p> <p>Good thing, too.... Rueben is the worst super-spy ever.&nbsp;</p> <p>When New York City comes under threat of nuclear destruction, Rueben is the only one who can save the city. But even an infinite number of redos is not enough, for lurking in the background is a nefarious force threatening not only NYC, but also the world.&nbsp;</p> <p>Rueben and his trusted friends must find a way to stop this evil from consuming everything and everyone. And the only way to do it is by dying again to save the world.</p>"; 
